import { ChangeEvent, useState } from "react";
import st from "./Login.module.scss";

const Login = () => {
  const [id, setId] = useState<string>();
  const [pw, setPw] = useState<string | ChangeEvent>();

  console.log(id, pw);

  return (
    <section className={st.login}>
      <div>Login</div>
      <form>
        <label>
          ID
          <input onChange={(e) => setId(e.target.value)} placeholder="ID" />
        </label>
        <label>
          PW
          <input onChange={(e) => setPw(e.target.value)} placeholder="PW" />
        </label>

        <button>SUBMIT</button>
      </form>
    </section>
  );
};

export default Login;
